import './App.css';
import Header from './components/Header';
import ToDoBoard from './components/ToDoBoard';
import DoneBoard from './components/ActionBar';

function App() {
  return (
    <div className="App">
      <Header />
      <ToDoBoard />
      <DoneBoard />
    </div>
  );
}

export default App;
